<?php

# @autogenerated
declare(strict_types=1);

namespace Civi\Lughauth\Features\Test\Plan\PlanTenant\Domain\ValueObject\Accesor;

use Civi\Lughauth\Features\Test\Plan\PlanTenant\Domain\ValueObject\PlanTenantNameVO;

trait PlanTenantNameAccesor
{
    private PlanTenantNameVO $_name;
    public function getName(): string
    {
        return $this->_name->value();
    }
    public function name(): PlanTenantNameVO
    {
        return $this->_name;
    }
    public function isNameChanged(?self $original = null): bool
    {
        return $this->_name->value() !== ($original ? $original->_name->value() : null);
    }
    public function withName(PlanTenantNameVO|string $name): self
    {
        $copy = clone $this;
        $copy->_name = PlanTenantNameVO::from($name);
        return $copy;
    }
}
